def report(actual, predict):
    # 计算多分类的准确率
    accuracy = accuracy_score(actual, predict)

    # 计算多分类的 F1 值 (macro-average)
    f1_macro = f1_score(actual, predict, average='macro')

    # 计算多分类的 F1 值 (weighted-average)
    f1_weighted = f1_score(actual, predict, average='weighted')

    # 将4作为正类，其余作为负类
    binary_predict = [1 if x == 4 else 0 for x in predict]
    binary_actual = [1 if x == 4 else 0 for x in actual]

    # 计算二分类的各项指标
    binary_accuracy = accuracy_score(binary_actual, binary_predict)
    binary_precision = precision_score(binary_actual, binary_predict)
    binary_recall = recall_score(binary_actual, binary_predict)
    binary_f1 = f1_score(binary_actual, binary_predict)
    tn, fp, fn, tp = confusion_matrix(binary_actual, binary_predict).ravel()
    binary_specificity = tn / (tn + fp)

    print(f"Multi-class Accuracy: {accuracy:.4f}")
    print(f"Multi-class F1 (Macro): {f1_macro:.4f}")
    print(f"Multi-class F1 (Weighted): {f1_weighted:.4f}")
    print(f"Binary Accuracy: {binary_accuracy:.4f}")
    print(f"Binary Precision: {binary_precision:.4f}")
    print(f"Binary Recall: {binary_recall:.4f}")
    print(f"Binary Specificity: {binary_specificity:.4f}")
    print(f"Binary F1: {binary_f1:.4f}")

print('TCN:')
report(tcn_actual, tcn_predict)
